languages.text:
Не было равных в Клыке{br}
По силе и смеху Арнульфу.{br}
Могучей рукой повергал он чудовищ,{br}
Смехом своим отгонял он холод Хельвинтра.{br}
Скьоль!{br}

No equal there was in the Fang{br}
To Arnoolf in might and mirth.{br}
Monsters with strong hand smiting,{br}
Helwinter's bite with laughter ousting.{br}
Skal!{br}

